import React from 'react';
import Navbar from '../components/Navbar';
import Footer from '../components/Footer';
import CoursesSection from '../components/CoursesSection';

const CoursesPage = () => (
  <>
    <Navbar />
    <CoursesSection />
    <Footer />
  </>
);

export default CoursesPage;
